// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;

import "./SetGrade.sol";
import "./User.sol";

contract Certificate is User {
    struct certificate {
        uint256 id;
        string name; //tn bng, bng CNTT hoc TVT
        string cpa;
        string grade;
        uint256 timestamp;
        uint256 exportTime;
        uint256 NumOfExports;
        address issuer;
        // address recipient; // c cn trng ny khng?
        bool signed;
        bool visible;
    }

    certificate[] certificateList;
    mapping(string => uint256[]) studentCerts;
    mapping(string => uint256) studentCertCount;
    mapping(uint256 => string) idToAddress;
    uint256 signedCertCount;
    uint256 visibleCertCount;

    using SetGrade for string;

    //tao bang chinh thuc cho student
    function createCertificate(string memory _studentId)
        public
        onlyAADepartmentUser
    {
        //require(studentCertCount[_studentId] == 0); // ch to c bng cho nhng sinh vin cha c too
        certificate memory temp;
        temp.id = certificateList.length;
        temp.name = idToStudent[_studentId].major;
        temp.cpa = idToStudent[_studentId].cpa;
        temp.grade = SetGrade.setGrade(idToStudent[_studentId].cpa);
        temp.timestamp = block.timestamp;
        temp.NumOfExports = 0;
        temp.visible = false;

        certificateList.push(temp);
        studentCerts[_studentId].push(certificateList.length - 1);
        idToAddress[certificateList.length - 1] = _studentId;
        studentCertCount[_studentId] += 1;
    }

    //tao bang kep cho student
     function createDoubleCertificate(string memory _studentId, string memory _name, string memory _cpa)
        public
        onlyAADepartmentUser
    {
        certificate memory temp;
        temp.id = certificateList.length;
        temp.name = _name;
        temp.cpa = _cpa;
        temp.grade = SetGrade.setGrade(_cpa);
        temp.timestamp = block.timestamp;
        temp.NumOfExports = 0;
        temp.visible = false;

        certificateList.push(temp);
        studentCerts[_studentId].push(certificateList.length - 1);
        idToAddress[certificateList.length - 1] = _studentId;
        studentCertCount[_studentId] += 1;
    }

    function getStudentByCert(uint _id) public view returns(student memory){
        student memory temp = idToStudent[idToAddress[_id]];
        return temp;
    }

    function signCertificate(uint256 _index) public onlyCurrentRector {
        //require(certificateList[_index-1].siged == false); // ch k c nhng chng ch no cha k
        require(certificateList[_index].signed == false);
        certificateList[_index].issuer = msg.sender;
        certificateList[_index].signed = true;
        certificateList[_index].visible = true;

        signedCertCount++;
    }

    // hm ny chy lc thng student xem cer cu n
    function seeMyCertificate()
        public
        view
        onlyStudent
        returns (certificate[] memory)
    {
        string memory studentId = studentDetails[msg.sender].id;
        certificate[] memory studentCertificates =
            new certificate[](studentCertCount[studentId]);
        for (uint256 i = 0; i < studentCertCount[studentId]; i++) {
            studentCertificates[i] = certificateList[
                studentCerts[studentId][i]
            ];
        }
        return studentCertificates;
    }

    function changeCertVisibility(uint256 _index) public onlyStudent {
        certificateList[_index].visible = !certificateList[_index].visible;
        if (certificateList[_index].visible) {
            visibleCertCount++;
        } else {
            visibleCertCount--;
        }
    }

    // cng ty check cc bng ca 1 sinh vin
    function seeStudentCerts(string memory _studentId)
        public
        view
        returns (certificate[] memory)
    {
        require(companyDetails[msg.sender].isActive == true);
        uint256 count = studentCerts[_studentId].length;
        certificate[] memory studentCertificates = new certificate[](count);
        for (uint256 i = 0; i < studentCerts[_studentId].length; i++) {
            if (certificateList[studentCerts[_studentId][i]].visible)
                studentCertificates[i] = certificateList[
                    studentCerts[_studentId][i]
                ];
        }
        return studentCertificates;
    }

    // cng ty xem cert cng khai
    function seeVisibleCerts() public view returns (certificate[] memory) {
        require(companyDetails[msg.sender].isActive == true);
        certificate[] memory allVisibleCerts =
            new certificate[](signedCertCount);
        uint256 count = 0;
        for (uint256 i = 0; i < certificateList.length; i++) {
            if (certificateList[i].visible) {
                count++;
                allVisibleCerts[count] = certificateList[i];
            }
        }
        return allVisibleCerts;
    }

    //nh trng xem ht
    function seeAllCerts()
        public
        view
        onlyRectorOrAAD
        returns (certificate[] memory)
    {
        return certificateList;
    }
}
